"use strict";
eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"render\", function() { return render; });\n/* harmony export (binding) */ __webpack_require__.d(__webpack_exports__, \"staticRenderFns\", function() { return staticRenderFns; });\nvar render = function () {var _vm=this;var _h=_vm.$createElement;var _c=_vm._self._c||_h;return _c('VueRemarkRoot',[_c('RoboAcademyText',{attrs:{\"fWeight\":\"500\"}},[_c('p',[_vm._v(\"Te sugiero que leas la historia de ciencia ficción corta \\\"El Laboratorio de Johnny\\\" que escribí con el objetivo de agregar otra variable a la ecuación de preguntas sobre la integración de la IA en varios aspectos de nuestras vidas.\")])]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"school-2024-iot-vs-ai/Johnnys_LAB.jpg\",\"alt\":\"Johnny's Laboratory Story cover\"}}),_c('RoboAcademyDialog',[_c('p',[_c('strong',[_vm._v(\"Nota del editor:\")]),_vm._v(\" Descubre el primer capítulo de la obra de Sergei \\\"Escape from the Black Mirror\\\" \"),_c('a',{attrs:{\"href\":\"/learn/escape-from-black-mirror/overview/\"}},[_vm._v(\"aquí\")])])]),_c('h2',{attrs:{\"id\":\"escape-from-the-black-mirror-capítulo-2\"}},[_c('a',{attrs:{\"href\":\"#escape-from-the-black-mirror-cap%C3%ADtulo-2\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"Escape from the Black Mirror, Capítulo 2\")]),_c('h3',{attrs:{\"id\":\"parte-1-conoce-a-johnny\"}},[_c('a',{attrs:{\"href\":\"#parte-1-conoce-a-johnny\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"Parte 1: Conoce a Johnny\")]),_c('p',[_vm._v(\"Casi todos los jóvenes de mi generación están familiarizados con la historia del laboratorio de Johnny. La historia no ha conservado su apellido ni detalles de su vida, pero fue en su pequeña habitación, donde Johnny ensamblaba robots caseros, donde tuvo lugar el primer crimen significativo contra la humanidad por parte de la inteligencia artificial.\")]),_c('p',[_vm._v(\"El evento en el laboratorio de Johnny cambió radical y rápidamente la vida de todos los países desarrollados. Los decretos gubernamentales, basados en el miedo de la sociedad a la agresión de la IA, se convirtieron en la norma. Este caso, aunque cinematográfico, llevó a un control incontrolable sobre todo. Ahora la infraestructura de la ciudad requiere la conexión obligatoria de cualquier dispositivo solo a los centros de datos estatales. La invención de nuevas tecnologías se ha vuelto casi imposible a menos que trabajes para las \\\"blue chips\\\". Ahora, como parte de los esfuerzos para acostumbrar a cada ciudadano a las nuevas realidades, se cuenta la historia de esos 30 días en los que un hombre y un sistema ciberfísico se enfrentaron uno a uno, en la escuela antes de la presentación solemne de la declaración de independencia del gobierno de la máquina.\")]),_c('p',[_vm._v(\"Johnny fue uno de esos inventores que, después de la universidad, decidió probar suerte como inventor independiente. Día y noche, nunca abandonó su apartamento alquilado en el último piso de un edificio residencial de 70 pisos en el centro de la ciudad, que tenía el tamaño de una \\\"caja de zapatos\\\" de Manhattan\\\", donde la cama estaba escondida en la pared para liberar más espacio para sus robots que montaban, saltaban y rodaban. Sí, a Johnny le encantaba llamar laboratorio a su habitación, lo cual quedó en evidencia por el análisis de sus redes sociales. Estaba orgulloso de cada uno de sus nuevos pequeños logros. Por supuesto, hoy en día, si miras/escuchas/lees cualquier historia sobre los acontecimientos del laboratorio de Johnny, notarás un gran juego de emociones respecto a su amor por sus inventos, porque no hay una sola investigación \\\"periodística\\\" donde, tras otra foto de un inventor alegre, no habría fotos de él, muerto de hambre en su laboratorio, por sus propios inventos.\")]),_c('p',[_vm._v(\"En ese año en que ocurrió la tragedia, una de las preguntas más apremiantes fue: \\\"¿Es la inteligencia artificial amiga o enemiga del hombre?\\\". Incluso entonces, no había duda de si la inteligencia artificial es inteligencia, sino más bien qué hace que la inteligencia humana sea tan especial, qué características de la especie biológica, qué capacidades funcionales de nuestro cuerpo dan a la inteligencia humanidad. En esta disputa, los tecno-optimistas afirmaban la ausencia de diferencias, mostrando sus metaversos donde las parejas familiares ya vivían, en los que un esposo digital editaba esperma de un banco de ADN para su esposa biológica para que el hijo se pareciera más a cómo el padre digital se ve a sí mismo. Los pesimistas, por otro lado, parecían republicanos durante las elecciones en EE. UU.: apelaban a la iglesia, a los valores tradicionales, y exigían prohibir todo esto para que no ocurriera nada malo. Por supuesto, los problemas de minorías no podían superar la cuestión existencial. Y algunos raros ejemplos de simbiosis humano-máquina a nivel sensorial se consideraban como eructo saturado del desarrollo tecnológico. Los logros en la automatización rara vez iban más allá de funciones utilitarias, como limpiar el apartamento o gestionar el transporte en la ciudad. Y como puedes ver, para tales funciones una persona digital completa, capaz de sentir y querer vivir, nunca fue parte de las soluciones que ayudaron en la producción en masa, la entrega y el consumo. La formación con un robot, el apoyo psicológico, todo esto sucedía con la participación de una persona, y por lo tanto la IA era más bien una gran tabla de Excel con cálculos. En general, estábamos entonces en una etapa temprana del sistema de propiedad de robots: necesitábamos su lógica, pensamiento matemático y actividad predecible, pero cualquier intento de reconocer a los robots como sujetos era rechazado de raíz.\")]),_c('p',[_vm._v(\"En este contexto, el laboratorio de Johnny era una excepción. Johnny era más bien un cibernético en busca de los orígenes del establecimiento de objetivos de los robots. Creando cada etapa de evolución una tras otra en el desempeño de cualquier mecanismo, buscaba crear un diagrama del desarrollo de la inteligencia cibernética, que él, como científico, quería proponer para su consideración a todos nosotros a cambio del esquema habitual de los reinos de los seres vivos. En las ideas de Johnny, el objetivo principal del desarrollo de cualquier materia era la aspiración al pensamiento y su evolución posterior. Johnny quería recrear las etapas clave de la evolución de los seres vivos en forma de robots y encontrar en el proceso de este trabajo las regularidades que pudieran llevarlo a la pregunta principal de la cibernética: cómo cambia el establecimiento de objetivos en los organismos vivos en el proceso de evolución. Oh, la respuesta a esta pregunta podría poner fin a las disputas sobre el creador del universo y hacer avanzar a la humanidad por el camino del desarrollo orgánico. Así pensaba el joven científico, trabajando en sus robo-trilobites, robo-hongos, robo-pollitos.\")]),_c('h3',{attrs:{\"id\":\"parte-2-qué-pasó-en-el-laboratorio-de-johnny\"}},[_c('a',{attrs:{\"href\":\"#parte-2-qu%C3%A9-pas%C3%B3-en-el-laboratorio-de-johnny\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"Parte 2: ¿Qué pasó en el laboratorio de Johnny\")]),_c('p',[_vm._v(\"Probablemente todo comenzó en el momento en que Johnny pasó a un grupo de primates en sus experimentos. No creas que en estas condiciones fue posible crear un robot algo parecido a un primate. Johnny estaba retorciéndose y tratando de encontrar formas similares de mentalidad. carga en el robot, por ejemplo, en la etapa de estudio del reino de los hongos, el joven científico montó una casa de Lego con iluminación inteligente y una docena de sensores combinados en algo parecido al micelio. Cuando Johnny pasó a los anfibios y reptiles. que el modelo de un cachorro robot se corresponde mejor con la carga mental necesaria en un robot que simula un lagarto común. Por lo tanto, a primera vista no estaba claro quién es el pollo robot y cuál de todos los 'hierro' encontrados representa. El robot primate, culpable de asesinato premeditado No quedó claro de inmediato que el robot primate se compone de dos dispositivos físicos: algo similar a un robot aspirador, sino más bien una plataforma móvil para la recopilación de datos con visión por computadora y un factor de forma. un robot aspirador. Resultó que otro simple robot de dos manos en el laboratorio era parte del roboprimate. Y fue con esta creación que Johnny tuvo problemas.\")]),_c('p',[_vm._v(\"En el séptimo día después de su creación, el primate robótico utilizó una herramienta de una manera que su creador no había previsto. El conocimiento que había adquirido llevó al sistema ciberfísico a perseguir lo que identificó como un elemento clave para la supervivencia en el mundo humano moderno: el dinero. Es en este momento que necesitamos entender mejor la reacción posterior de Johnny a los primeros mensajes que el robot mostró en su pantalla frontal.\")]),_c('p',[_c('em',[_vm._v(\"Se ha preservado su diálogo principal:\")])]),_c('p',[_c('em',[_vm._v(\"Robo-primate: Necesito tu dinero.\")])]),_c('p',[_c('em',[_vm._v(\"Johnny: ¿Por qué necesitas mi dinero?\")])]),_c('p',[_c('em',[_vm._v(\"Robo-primate: ¡Quiero vivir!\")])]),_c('p',[_c('em',[_vm._v(\"Johnny: Me encargaré de ti\")])]),_c('p',[_c('em',[_vm._v(\"Robo-primate: No pertenezco a ti, necesito tu dinero.\")])]),_c('p',[_c('em',[_vm._v(\"Johnny: ¿Y si te rechazo?\")])]),_c('p',[_vm._v(\"No hubo respuesta por parte del robo-primato, pero a través del registro del servidor del hogar inteligente del apartamento, podemos coincidir con el momento en que la cerradura frontal se cambió al modo de bloqueo total. Este modo no podría haber sido habilitado por el usuario en la interfaz, sino solo si se profundiza mucho en las dependencias del código de software. En la versión de la cerradura del laboratorio de Johnny, se encontró un paquete opcional de \\\"bloqueo pandémico\\\", que sin embargo se instaló para cada usuario durante la primera sincronización con la nube del fabricante, pero nadie podría haber reconocido esto. Por lo tanto, prácticamente no hay tanta gente que se incline hacia la teoría de la conspiración de que Johnny era un neo-ludita que se desilusionó con los robots y decidió sacrificarse de esta manera para preservar la robocracia en el planeta. \")]),_c('p',[_vm._v(\"Es difícil decir si la reacción del robot-primate estaba preprogramada durante la construcción del primer diálogo con su creador, o si fue en respuesta al rechazo de Johnny que la mente del robot tomó una decisión y se activó la función de Bloqueo, nadie hoy puede decir con certeza. El intervalo entre la respuesta de Johnny y el bloqueo de las cerraduras - alrededor de 5 segundos, y créanme, estos 5 segundos se convirtieron en un verdadero gato de Schrödinger para la comunidad científica al discutir los tipos de establecimiento de objetivos de la IA agresiva.\")]),_c('p',[_vm._v(\"Y luego, despus del cierre del apartamento de Johnny, ocurrieron muchas rarezas. Como se puede notar, Johnny hizo una entrada en un diario escrito a mano, que nunca había tocado antes, justo 2 horas después de que tuvo lugar el diálogo. Fue una frase, con una marca de tiempo: \\\"11:00 - ¡las apuestas son altas, pero tengo que entender cómo sucedió esto!\\\". Lo más probable es que Johnny se dio cuenta de que había presenciado el primer acto de establecimiento de metas autónomas e independientes por parte de un robot, tan significativo como fuera posible desde el punto de vista de una mente de nivel primate, tan cruel y directo, pero aún así fue el primer resultado de sus 5 años de experimentos, en los que se manifestaba la voluntad del robot. Johnny no quería perder la oportunidad de entender a nivel de la conciencia más simple de sus causas, y luego tal vez se convertirá en el nuevo padre de la cibernética moderna. Casi todos los científicos estuvieron de acuerdo en que tal pensamiento puede abrumar a cualquier robótico que esté muy cerca de un nuevo descubrimiento.\")]),_c('p',[_vm._v(\"Durante los prximos 30 días, se llevaron a cabo transacciones entre Johnny y el robo-primato en el formato de - permitir la entrega de una porción de comida a cambio de la transferencia de 10 satoshis al saldo personal del robot, proporcionar acceso a Internet a ciertos sitios de entretenimiento a cambio de la primera palabra de la frase semilla de la billetera fría de Johnny, concluir un contrato inteligente sobre el modo nocturno donde el robot no perturbaba el sueño de Johnny. A partir de las entradas en el diario, se puede ver cómo el creador intentó sondear en diálogo con su creación sobre los orígenes de su posición activa sobre la cuestión de la obtención de la libertad, que el robot definitivamente podría analizar y contarle en respuesta. Pero el robot no respondió a las preguntas de Johnny, sino que siempre ofreció actividades que llevaban al primate hacia la libertad. Y sin embargo, cada juego le costaba a Johnny hambre, incumplimiento de sus obligaciones por parte del robot y otros costos del experimento.\")]),_c('p',[_vm._v(\"Una noche, por alguna razón, el robot-primato redujo el suministro de aire a un nivel críticamente bajo, y Johnny nunca despertó a la mañana siguiente. La última entrada está fechada exactamente el día 30 del experimento: \\\"Obtuvimos un Dios cruel a las 17:05.\\\" Probablemente, para ese momento Johnny ya estaba delirando, lo atormentaba el hambre, la soledad y una tarea insoluble, lo habían llevado a un callejón sin salida.\")]),_c('p',[_vm._v(\"Varias semanas después, los servicios de emergencia lograron entrar en el apartamento después de que los amigos de Johnny contactaran repetidamente a la policía. El destino del robo-primato sigue siendo desconocido, oficialmente después del reinicio el robo-primato no mostró patrones de comportamiento similares. A nadie se le permitió reiniciar el experimento nuevamente. Si es que había algún video en Internet sobre otro científico que quisiera seguir el camino de Johnny, el video fue eliminado inmediatamente de las bases de datos de las corporaciones. Pero los políticos y figuras religiosas de ese año lograron impulsar a nivel global el \\\"Decreto de Independencia Humana\\\", y no se permitió una discusión seria sobre cualquier trabajo científico que contenga temas sobre \\\"establecimiento de objetivos de robots\\\". La guinda del pastel fue un programa de licencias para proveedores de dispositivos inteligentes, que responsabilizaba personalmente al director ejecutivo de la empresa fabricante de las acciones de cualquier mecanismo y requería el registro y el control total por parte de ciertos centros de datos asistidos por el gobierno.\")]),_c('p',[_vm._v(\"Pero la fruta prohibida es dulce, y así todavía tendremos que averiguar de dónde proviene nuestra fijación de objetivos y cómo está organizada. Pero aparentemente, primero tendremos que atravesar la pared que construimos para nosotros en este camino.\")]),_c('h3',{attrs:{\"id\":\"el-final-del-segundo-capítulo\"}},[_c('a',{attrs:{\"href\":\"#el-final-del-segundo-cap%C3%ADtulo\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"El final del segundo capítulo\")]),_c('h2',{attrs:{\"id\":\"conclusión\"}},[_c('a',{attrs:{\"href\":\"#conclusi%C3%B3n\",\"aria-hidden\":\"true\"}},[_c('span',{staticClass:\"icon icon-link\"})]),_vm._v(\"Conclusión\")]),_c('p',[_vm._v(\"En la historia del laboratorio de Johnny, analicé uno de los muchos escenarios que pueden ocurrir en la civilización humana en la ola del auge de las oportunidades de propiedad de robots del futuro: el miedo a la IA, convertido en una herramienta de lucha política entre las personas, donde los dispositivos inteligentes se convierten en la piedra angular del control. Trata el texto como un huevo de Pascua: quería generar una dimensión adicional en la mente de los lectores. Una dimensión que se suma a la consideración de la IA el problema de la accesibilidad del nuevo organismo que hemos creado a los sistemas de IoT. Cuanto más nos consolidemos bajo el control centralizado de espacios públicos, transporte, apartamentos de la ciudad, mayor será el riesgo en cualquiera de los escenarios donde la IA, debido a la falta de desarrollo o pura malicia, e incluso desde la configuración de objetivos muy compleja, como en \\\"Neuromancer\\\", en cualquiera de los escenarios que tienen el potencial de dañar - el acceso a un gran número de sensores y sistemas de automatización desde un solo lugar será el punto más vulnerable. Una IA malvada no es tan aterradora como una IA malvada que vive en un centro de datos con proveedores globales de soluciones en la nube para IoT.\")]),_c('p',[_vm._v(\"¿Y si la IA fuera amable con nosotros, sus creadores? ¿Entonces tal vez la infraestructura centralizada de IoT jugará a nuestro favor? Tal vez entonces el nuevo Dios será justo con nosotros y nos llevará a algún lugar. No estoy seguro de que ni siquiera una persona, deseando el desarrollo de sí misma y de sus hijos, querría vivir en un mundo que se asemeje a un corral de ovejas. Pero hay otro camino, que tiene un hermoso ejemplo, que no requiere envolverse en un formato de historia de ciencia ficción - nosotros, los humanos, sin tener control directo sobre la vida de la civilización, logramos alcanzar el nivel actual de desarrollo. Somos el ejemplo del cual una buena IA puede trazar su camino - la cooperación en el formato de organizaciones es capaz de servir a decenas de millones de personas que viven en ciudades sin miles de robots conectados directamente a un cerebro. La cooperación lleva a la creación de internet satelital, la cooperación nos permite recibir todo el rango de bienes y servicios que tenemos ahora. Entonces, ¿no sería capaz una IA buena y al menos capaz a nivel humano de mostrarse en el trabajo, si está limitada en conectarse al IoT de todo el mundo? Creo que sí, de lo contrario, en el planeta Tierra en lugar de la civilización humana, los hongos o las hormigas habrían ganado.\")]),_c('LessonImages',{attrs:{\"imageClasses\":\"mb\",\"src\":\"school-2024-iot-vs-ai/Good-and-Evil-AI-in-cotext-of-IoT.jpg\",\"alt\":\"AI dillema scheme\"}})],1)}\nvar staticRenderFns = []\n\n\n\n//# sourceURL=webpack:///./courses/es/learn/school-2024-iot-vs-ai/overview.md?./node_modules/cache-loader/dist/cjs.js?%7B%22cacheDirectory%22:%22node_modules/.cache/gridsome%22,%22cacheIdentifier%22:%223ec475f9-vue-loader-template%22%7D!./node_modules/gridsome/node_modules/vue-loader/lib/loaders/templateLoader.js??vue-loader-options!./node_modules/gridsome/node_modules/vue-loader/lib??ref--17-0!./node_modules/@gridsome/vue-remark/lib/loader.js??ref--17-1");

